import React, { useState } from "react";

export const Registor = (props) => {
  const [text, setText] = useState(""); // to set the data of the user
  const [pass, setPass] = useState("");
  const [verpass, setVerpass] = useState("");
  const [num, setNum] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(text);
    console.log(num);
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <label htmlFor="text">Name</label>
        <input
          value={text}
          type="text"
          placeholder="Full Name"
          id="text"
          name="text"
        />
        <label htmlFor="Roll No.">Roll No.</label>
        <input value={num} type="phone" placeholder="Roll No." id="number" />
        <label htmlFor="password">Password</label>
        <input
          value={pass}
          type="password"
          placeholder="password"
          id="password"
          name="password"
        />
        <label htmlFor="verify-password">Password</label>
        <input
          value={verpass}
          type="password"
          placeholder="verify-password"
          id="vpassword"
          name="vpassword"
        />

        <button type="submit">Sign Up</button>
      </form>
      <button onClick={() => props.onFromSwitch("login")}>
        Already have an account? Login
      </button>
    </div>
  );
};
